import React from 'react';
import './Status.scss';
import Icon from './Icon';

const Status = (props) => {
  return (
    <div className="col weatherStatus">
      <Icon />
      <h2>{ props.weatherData.desc.description }</h2>
      <p>{ props.location }</p>
      <h3>{ props.weatherData.temp } <sup>o</sup></h3>
    </div>
  )
}

export default Status;
